import React from "react";
import { Link } from "react-router-dom";

function Ad({ ad }) {
  return (
    <Link to={`/ads/${ad.id}`}>
      <div>
        <h2>{ad.name}</h2>
        <p>{ad.description}</p>
        <img src={ad.image} alt="product/service" />
        <h3>${ad.price}</h3>
      </div>
    </Link>
  );
}

export default Ad;
